import { makeStyles } from "@material-ui/core/styles";

const useStylesIcon = makeStyles({

  Icon: {
    color: 'gray',
    fontSize: '40px'
  },
  FormControl: {
    minWidth: 12000
  },
  list: {
    width: 200
  },
  fullList: {
    width: "auto"
  },
  link: { textDecoration: 'none' },

  palette: {
    primary: {
      main: '#ffffff',
    },
    secondary: {
      main: '#76B900',
    },
  }
});


export default useStylesIcon
